import { observable, action, makeObservable } from "mobx";
import { myStatus } from "./request"
class HomeState {
 constructor() {
  makeObservable(this)
 }
 @observable data = {};

 @action
 changeData = (val: any) => {
  this.data = val;
 }
 @action
 refreshData = () => {
  myStatus({}).then(data=>{
   this.changeData(data)
  })
 }
}
export default HomeState;
